import { useEffect, useState } from "react";

function Home() {
  const [data, setData] = useState([
    {
      title: "شسيب",
      job: "Frontend",
      info: "شيب",
      id: 2,
    },
    {
      title: "هل الحياة جميلة ؟",
      job: "Back End",
      info: " نعم ولم لا انها شيء لا يتكرار مرتين",
      id: 3,
    },
    {
      title: "this is me Q",
      job: "Back End",
      info: "it's a good Q\n",
      id: 5,
    },
  ]);

  useEffect(() => {
    console.log(data[0].job);
  }, []);

  return (
    <div className="Home">
      {data.map((rsp) => (
        <div className="card w-96 bg-success  text-success-content">
          <div className="card-body">
            <h2 className="card-title">{rsp.title}</h2>
            <p>{rsp.info}</p>
            <div className="card-actions justify-end">
              <button className="btn">Buy Now</button>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
}

export default Home;
